import React from 'react';
import '/Rules.css';

export default function Rule() {
    return (
        <div className="text">
            Each player places the 5 ships somewhere on their board. 
            Player's take turns guessing by calling out the coordinates. 
            Both players should mark their board with pegs:  red X for hit, green check for miss.
        </div>
    )
}
